import React, { Component } from 'react'
import "./styles.css"



class App extends Component {
  constructor(props) {
    super(props)
    this.changeCounter = this.changeCounter.bind(this)
    this.state = {
      counter : 5,
      show : true
    }
  }

  changeCounter() {
    this.setState({ counter : 12 })
  }
  changeShow = () => {
    this.setState({ show: true? false: true})
  }
  render() {
    return (
      <div>
        <h1>ToDo List</h1>
        <input type="text"/>
        <button onSubmit>Add</button>
        </div>
    )
  }
}


export default App;
